import { Route, Routes } from "react-router-dom";

import Header from "./components/header";
import Footer from "./components/footer";
import CartPage from "./pages/cartPage";
import Questions from "./components/questions";
import Feedback from "./components/feedback";
import Slider from "./components/slider";
import Autorization from "./pages/autorization";

import "./style.scss";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import { useEffect, useState } from "react";
import PageTemplate from "./pages/PageTemplate";
import Search from "./components/search";

const mockData = [
  {
    name: `Кастомна чашка з фото "Моя ти киця"`,
    price: 499,
    oldPrice: 599,
    redText: "Топ продаж",
    images: ["cart-img.image.png", "57086714.png"],
  },
  {
    name: `Кастомна чашка з фото "Моя ти киця"`,
    price: 499,
    oldPrice: 599,
    redText: "Топ продаж",
    images: ["cart-img.image.png", "57086714.png"],
  },
  {
    name: `Кастомна чашка з фото "Моя ти киця"`,
    price: 499,
    oldPrice: 599,
    redText: "Топ продаж",
    images: ["cart-img.image.png", "57086714.png"],
  },
  {
    name: `Кастомна чашка з фото "Моя ти киця"`,
    price: 499,
    oldPrice: 599,
    redText: "Топ продаж",
    images: ["cart-img.image.png", "57086714.png"],
  },
  {
    name: `Кастомна чашка з фото "Моя ти киця"`,
    price: 499,
    oldPrice: 599,
    redText: "Топ продаж",
    images: ["cart-img.image.png", "57086714.png"],
  },
  {
    name: `Кастомна чашка з фото "Моя ти киця"`,
    price: 499,
    oldPrice: 599,
    redText: "Топ продаж",
    images: ["cart-img.image.png", "57086714.png"],
  },
];

const HomePage = () => {
  window.scrollTo(0, 0);

  return (
    <>
      <section
        className="firstSection"
        style={{ background: `url("img/BG.jpg")` }}
      >
        <h1 className="firstSection__title">Mister Gifter</h1>
        <p className="firstSection__description">Найдивовижніші подарунки!</p>
        <button className="firstSection__button">дивитись чашки</button>
      </section>
      <Slider title="Найпопулярніші товари" />

      <Slider title="Big Size" />
      <section className="box">
        <h2 className="title box__title ">Вибери потрібний подарунок</h2>
        <div className="box__img-wrapper">
          <img className="box__img" src="img/carts/5.png" />
        </div>
        <h2 className="title box__title-blue ">Для нього</h2>
        <div className="box__img-wrapper">
          <img className="box__img" src="img/carts/5.png" />
        </div>
        <h2 className="title box__title-red">Для неї</h2>
      </section>
      <Slider title={"Подуранкові бокси"} />
      <Questions />
    </>
  );
};

const App = () => {
  const [token, setToken] = useState("");
  useEffect(() => {
    console.log(token);
  }, [token]);
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route path="" element={<HomePage />} />
        <Route path="page" element={<CartPage />} />
        <Route path="cart" element={<CartPage />} />
        <Route
          path="autorization"
          element={<Autorization token={token} setToken={setToken} />}
        />
        <Route
          path="registration"
          element={<Autorization token={token} setToken={setToken} />}
        />
        <Route
          path="cupsWidthPhotos"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={true}
              isShowLables={false}
              isShowText={false}
            />
          }
        />
        <Route
          path="chameleon"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={true}
              isShowLables={false}
              isShowText={false}
            />
          }
        />
        <Route
          path="BisSize"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={true}
              isShowLables={false}
              isShowText={false}
            />
          }
        />
        <Route
          path="Boxs"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={true}
              isShowLables={true}
              isShowText={false}
            />
          }
        />
        <Route
          path="Delivery"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={false}
              isShowLables={false}
              isShowText={true}
              title="Про доставку"
              description="Намагаємось доставити ваше замовлення так швидко, як котик біжить як чує звук відкриття холодильнику.
              Оформлені до 18:00 замовлення відправляємо в той же день!
              Доставка Новою Поштою 1-3 дні. Оплатити можна при отриманні на пошті, або по передплаті на карту."
            />
          }
        />
        <Route
          path="AboutUs"
          element={
            <PageTemplate
              data={mockData}
              isShowCarts={false}
              isShowLables={false}
              isShowText={true}
              title="Про нас"
              description="Колись я оновлю цей блок і тут буде інформація про команду і те що ми зробили за весь час."
            />
          }
        />
      </Routes>

      <Feedback />
      <Search />
      <Footer />
    </div>
  );
};

export default App;
